import * as React from "react";
import { Container } from "@mui/material";

function footer(props) {
  return (
    <>
      <footer>
        <Container>
          <span className="MuiTypography-alignCenter">
            All rights reserved &copy; vvk-ecommerce-website
          </span>
        </Container>
      </footer>
    </>
  );
}

export default footer;
